metadata.description:
The Protopicture series by @studioolivervogt was realized in collaboration with an artificial intelligence that was recursively programmed with images and texts. The series is an expression of a current generative art based on systems and processes, defined by the conceptual use of algorithms and data. 

@studioolivervogt is based in Berlin and is represented by Weitenfeld Landaluce Gallery Berlin, wlgb.io 

Edition: Each NFT of the Protopicture series is a one of one.
